function pairElement(str) {
  const newArr = str.split('');
  return newArr.map(char => {
    switch (char) {
      case 'A':
        return ['A','T'];
      case 'T':
        return ['T','A'];
      case 'C':
        return ['C','G'];
      case 'G':
        return ['G','C'];
    }
  })
}

